import React from 'react';

const Navbar = ({filterItem, navList}) => {
 return (
  <>
        <nav className='navbar'>
            {
                navList.map((currElem) => {
                return(
                    <button className='navBtn' onClick={() => filterItem(currElem)}><span>{currElem}</span></button>
                )
               })
            }
        </nav>
</>
 )
  
}

export default Navbar;
